import React from 'react'
import ReactDOM from 'react-dom/client'

import './index.css';

const BookList = () => {

    return (
      <section className='booklist'>
        <Book></Book>
        <Book></Book>
        <Book></Book>
        <Book></Book>
      </section>
    )

};

const Book = () => {
    return (
        <article className='book'>
            <Image/>
            <Title/>
            <Author/>
        </article>
    );
};

const Image = () =>  (
  <img src='https://m.media-amazon.com/images/I/419aJfhczCL._SY445_SX342_.jpg'alt='Atomic habit'></img>
) ;

const Title = () =>  <h2>Atomic Habit</h2> ;

const Author = () =>  <h2 style={{color:'#617d98',fontSize:'0.75rem',}}>James Clear</h2> ;



const root = ReactDOM.createRoot(document.getElementById('root'));


root.render(<BookList/>);
